      "txt" : "<p><span style=\"color: rgb(34, 34, 34); font-family: &quot;times new roman&quot;, times; font-size: medium; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); display: inline !important; float: none;\">Мы собираем книги и с помощью волонтеров передаем в социальные организации. Уже передали 24 тысячи книг в 60 организаций. Мы заинтересованы, чтобы люди привозили к нам книги, также можем приезжать и забирать своими силами.</span></p>\n",
