      "id" : 94120,
      "txt" : "<p>Велакухня &quot;Гараж 38&quot; - бесплатная общественная веламастерская в центре города, место проведения мероприятий на велосипедную тематику. По всему миру существует много таких мест, и везде они становились центрами велосипедного жизни, собирающих вокруг себя самых активных и творческих людей.</p>\n\n<p>Велокухня &quot;Гараж 38&quot; основана Общественным объединением &laquo;Минское велосипедное общество&raquo; при поддержке Фонда &laquo;Экологический транспорт&raquo;.</p>\n\n<p>В &quot;Гаражи 38&quot; вы можете при помощи наших волонтеров научиться чинить и настраивать свой велосипед. Также вы можете воспользоваться инструментом, который есть в гараже, и запчастями, что пожертвовали другие велосипедисты.</p>\n\n<p>Мы проводим мастер-классы по ремонту и обслуживанию велосипедов, организуем дискуссии и просмотры фильмов на велосипедную тематику.</p>\n",
