      "place" : "Минск ",
      "txt" : "<p><span style=\"color: rgb(68, 68, 68); font-family: &quot;Open Sans&quot;, Arial, Verdana; font-size: 16px;\">Мы планируем создать творческое пространство с профессиональным швейным оборудованием, которым могут воспользоваться все желающие. Хотите &mdash; шейте, хотите &mdash; делайте ремонт одежды. В зале всегда будут присутствовать администраторы-технологи, они помогут в вопросах кройки и шитья. Это лучше, чем аренда швейной машинки или курсы кройки и шитья, потому что вы приходите и шьете с мастером все, что хотите и когда хотите. Бесплатно обучим новичков основам шитья и работе на оборудовании.</span></p>\n",
