      "lon" : 27.58654349999,
      "id" : 94115,
      "lvl" : [
         94112,
         94113
      ],
      "txt" : "<p>&nbsp;Добры ровар- система велосипедного проката, созданная на некоммерческой основе, которая позволяет арендовать велосипед на одной из велосипедных парковок, совершить поездку и вернуть велосипед на одну из предложенных парковок, установленных в этом же городе. Подобные программы успешно существуют во многих европейских и североамериканских городах.</p>\n\n<p>Цель программы - дать жителям и гостям Минска бесплатно, либо очень дешевый доступ к велосипеду для кратковременных (не более суток) поездок по городу, как альтернативу моторизованным общественному транспорту и автомобилю, тем самым улучшить транспортную и экологическую обстановку.</p>\n\n<p>Экологически-социальный проект &laquo;Добры ровар&raquo; - это инициатива выпускников Школы Экологического Активиста 2014 года, организованной обществом &quot;Зеленая Сеть&quot;.</p>\n\n<p>В рамках этого проекта мы совместно с Минское велосипедное общество решили сделать бесплатный велосипедный прокат в городе Минске!</p>\n"
