      "txt" : "<p><span style=\"color: rgb(36, 43, 45); font-family: Arial, &quot;Arial Unicode MS&quot;, Helvetica, sans-serif; text-align: justify; font-size: 12pt;\">Основными целями Фонда являются:&nbsp;</span><br style=\"color: rgb(36, 43, 45); font-family: Arial, &quot;Arial Unicode MS&quot;, Helvetica, sans-serif; font-size: 12px; text-align: justify;\" />\n<span style=\"color: rgb(36, 43, 45); font-family: Arial, &quot;Arial Unicode MS&quot;, Helvetica, sans-serif; text-align: justify; font-size: 12pt;\">Cодействие улучшению экологического состояния реки Припять,создание и организация общественного движения за здоровую и благоприятную экологическую обстановку.</span><br style=\"color: rgb(36, 43, 45); font-family: Arial, &quot;Arial Unicode MS&quot;, Helvetica, sans-serif; font-size: 12px; text-align: justify;\" />\n<span style=\"color: rgb(36, 43, 45); font-family: Arial, &quot;Arial Unicode MS&quot;, Helvetica, sans-serif; text-align: justify; font-size: 12pt;\">Задачи Фонда состоят в привлечении финансовых и интеллектуальных ресурсов для финансированияи осуществления проектов,направленных на улучшение экологического состояния реки Припять,обеспечение экологической безопасности населения.</span><br style=\"color: rgb(36, 43, 45); font-family: Arial, &quot;Arial Unicode MS&quot;, Helvetica, sans-serif; font-size: 12px; text-align: justify;\" />\n<br style=\"color: rgb(36, 43, 45); font-family: Arial, &quot;Arial Unicode MS&quot;, Helvetica, sans-serif; font-size: 12px; text-align: justify;\" />\n<span style=\"color: rgb(36, 43, 45); font-family: Arial, &quot;Arial Unicode MS&quot;, Helvetica, sans-serif; text-align: justify; font-size: 12pt;\">Общественный надзор за соблюдением экологического правопорядка на реке Припять и прибрежных территориях.</span><br style=\"color: rgb(36, 43, 45); font-family: Arial, &quot;Arial Unicode MS&quot;, Helvetica, sans-serif; font-size: 12px; text-align: justify;\" />\n<span style=\"color: rgb(36, 43, 45); font-family: Arial, &quot;Arial Unicode MS&quot;, Helvetica, sans-serif; text-align: justify; font-size: 12pt;\">Создание и поддержка деятельности &laquo;Детского экологического движения Мозырщины&raquo;</span><br style=\"color: rgb(36, 43, 45); font-family: Arial, &quot;Arial Unicode MS&quot;, Helvetica, sans-serif; font-size: 12px; text-align: justify;\" />\n<span style=\"color: rgb(36, 43, 45); font-family: Arial, &quot;Arial Unicode MS&quot;, Helvetica, sans-serif; text-align: justify; font-size: 12pt;\">Организация круглосуточной &laquo;Горячей линии&raquo; с целью фиксации сигналов нарушения закона &laquo;Об окружающей среде&raquo;.Передача полученных сигналов в соответствующие госорганы, их контрольное сопровождение до этапа решения проблемы с последующим освещением на сайте Фонда.</span><br style=\"color: rgb(36, 43, 45); font-family: Arial, &quot;Arial Unicode MS&quot;, Helvetica, sans-serif; font-size: 12px; text-align: justify;\" />\n&nbsp;</p>\n",
