      "txt" : "<p>Каждый человек, сделавший шаг навстречу энергосбережению, вносит посильную лепту в экономию энергоресурсов, и встает на защиту ее естественных источников. А каждая выключенная вовремя лампочка, каждая сэкономленная капля воды, каждый лишний градус тепла позволят поднять уровень жизни целого народа. Ребенок, приученный к экономии и бережливости с раннего детства, обязательно станет бороться с данной проблемой и во взрослой жизни. Именно по этому в средней школе №7 г.Речицы большое внимание уделяется вопросам формирования экологической грамотности и воспитанию культуры энергопотребления.</p>\n",
