      "place" : "Grodno",
      "txt" : "<p><strong>A detailed description of lyceum ecological activities:</strong></p>\n\n<p>The activities aimed at developing ecological competence and energy saving culture of lyceum students aresome of the key directionsofthe educational environment of our educational institution.</p>\n\n<p>&nbsp;</p>\n\n<p><strong>Educational, material and natural basis for the organization of ecological activities:</strong></p>\n\n<p>&bull; Energy and resources saving museum (founded in 2011)</p>\n\n<p>&bull; Ecological &ldquo;Health path&rdquo; (as an integral part of the museum devoted to sport and eco-tourism).</p>\n\n<p><strong>Ways of presenting ecological services:</strong></p>\n\n<p>&bull; Conducting excursions in the energy and resources saving museumto educate its visitors on the important issues of energy saving and the role of state policy in the field of energy and resources conservation.</p>\n\n<p>&bull; Heuristic lessons for primary school children aimed at educating them on the ways of saving energy and resources in everyday life (classes are conducted by lyceum students in the &quot;Peer-to-peer&quot; teaching mode).</p>\n\n<p>&bull; Used batteries collecting campaigns.</p>\n\n<p>&bull; Organization of video presentations made bythe young activists of lyceum ecological movement in the reading room of the lyceum.</p>\n\n<p>&bull; Open air classes on the &ldquo;ecological ground&rdquo; (with a summerhouse for conducting biology classes and relaxation), taking care of the rare species of plants,studying the ecosystem of the artificial pond).</p>\n\n<p>&bull; Projectingchildren&rsquo;s colouring books on ecological themes.</p>\n\n<p>&bull; Conducting debates on the global environmental issues,energy and resources saving with the students of YankaKupala Grodno State university and Medical university.</p>\n\n<p>&bull; Recyclables (metal and scrap paper) collecting campaigns (twice a year).</p>\n\n<p>&bull;Clean-up campaigns (&quot;Let&#39;s help our lyceum to look beautiful and clean&quot;,a clean-up campaign in the wood area near the Neman River).</p>\n\n<p>&bull;Tree-planting campaigns.</p>\n\n<p>Lyceum students do research in science and present their scientific papers at various scientific-practical conferences. As a result of their research they should come up with an &ldquo;ecological product&rdquo; which aims to improve the natural environment.</p>\n\n<p>We also widely use methods of psycho-pedagogical correction of senior students&rsquo;subjective attitude towards nature, method of ecological associations, interactive methods,method of artistic representation of natural objects, ecological identification method, ecological empathymethod,ecological reflection method, <a name=\"_GoBack\"></a>ecologicalperspective, etc.</p>\n",
