      "lon" : 27.2994391951,
      "act" : "гидрологический памятник природы местного значения",
      "place" : "Минск",
      "txt" : "<p>На южной окраине деревни Рогово Минского района есть полноводная криница с чистой и вкусной водой. К Роговскому роднику постоянно подъезжают машины, и люди наполняют привезённые с собой ёмкости, увозя по домам целебную, как считается, живительную влагу. Источник разделён на несколько небольших потоков. Некоторые вытекают из вмурованных в стену труб, а есть и ручей, бегущий по земле. Рядом устроены беседки, можно здесь же и отдохнуть. Роговский родник расположен вдали от крупных трасс, и может, поэтому о нём ещё мало известно. Но кто любит посещать белорусские криницы и пить именно родниковую воду, обязательно найдёт этот источник.</p>\n"
