      "txt" : "<p>Эксплуатирующая организация: ГУ &laquo;Объединение Минскмелиоводхоз&raquo;.</p>\n\n<p>Дата ввода в эксплуатацию: 2008 г.</p>\n\n<p>Мощность: 0,126 МВт.</p>\n\n<p>Марка и производитель оборудования: ГЭУ-75 ГЛК-273-12, &quot;ПС-Энергия&quot;, РБ.</p>\n\n<p>Годовая выработка электроэнергии: 1674 тыс. кВтч.</p>\n\n<p>Объем выработки электроэнергии за 1 полугодие 2016 г.: 212,846 тыс. кВтч.</p>\n"
