      "act" : "ландшафтный заказник",
      "lon" : 27.47231467307,
      "id" : 92917,
      "txt" : "<p><span style=\"color: rgb(34, 34, 34); font-family: arial; font-size: 14px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal; letter-spacing: normal; line-height: 20.3px; orphans: 2; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; display: inline !important; float: none; background-color: rgb(255, 255, 255);\">На юго-западе Минского района Минской области на площади 510 га расположен лесной массив, который в 1977 году получил статус особо охраняемой природной территории. Речь идет о Прилукском ландшафтном заказнике, занимающем часть Прилукской лесной дачи. Главной задачей, которую преследовали власти при создании ООПТ, стало сохранение в естественном состоянии ценных участков леса, дикорастущих растений, относящихся к видам, включенным в Красную книгу Беларуси, а также их мест произрастания. </span><br style=\"color: rgb(34, 34, 34); font-family: arial; font-size: 14px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal; letter-spacing: normal; line-height: 20.3px; orphans: 2; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);\" />\n<br style=\"color: rgb(34, 34, 34); font-family: arial; font-size: 14px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal; letter-spacing: normal; line-height: 20.3px; orphans: 2; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);\" />\n<span style=\"color: rgb(34, 34, 34); font-family: arial; font-size: 14px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal; letter-spacing: normal; line-height: 20.3px; orphans: 2; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; display: inline !important; float: none; background-color: rgb(255, 255, 255);\">Из местных пород в заказнике преобладают чистые и смешанные насаждения сосны и ели обыкновенной, дуба летнего, ясеня обыкновенного.</span><br style=\"color: rgb(34, 34, 34); font-family: arial; font-size: 14px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal; letter-spacing: normal; line-height: 20.3px; orphans: 2; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);\" />\n<br style=\"color: rgb(34, 34, 34); font-family: arial; font-size: 14px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal; letter-spacing: normal; line-height: 20.3px; orphans: 2; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);\" />\n<span style=\"color: rgb(34, 34, 34); font-family: arial; font-size: 14px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal; letter-spacing: normal; line-height: 20.3px; orphans: 2; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; display: inline !important; float: none; background-color: rgb(255, 255, 255);\">Название связано с небольшим населенным пунктом &laquo;Прилуки&raquo;. Этот поселок городского типа находится в 5-7 километрах от Минска на юг (по Слуцкому шоссе) на старом Несвижском тракте над рекой Птичь. Поселок Прилуки со всех сторон окружен заповедным лесом.</span><br style=\"color: rgb(34, 34, 34); font-family: arial; font-size: 14px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal; letter-spacing: normal; line-height: 20.3px; orphans: 2; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);\" />\n<br style=\"color: rgb(34, 34, 34); font-family: arial; font-size: 14px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal; letter-spacing: normal; line-height: 20.3px; orphans: 2; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);\" />\n<span style=\"color: rgb(34, 34, 34); font-family: arial; font-size: 14px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal; letter-spacing: normal; line-height: 20.3px; orphans: 2; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; display: inline !important; float: none; background-color: rgb(255, 255, 255);\">Заказник интересен не только лесом, но и холмистым ландшафтом, поэтому территория заказника &ndash; это место экологического туризма. Зимой туристы приезжают сюда на лыжные прогулки. Ближайшие к заказнику населенные пункты: п. Прилуки, п. Прилукская Слобода, Скориничи.</span></p>\n",
