      "title" : "ГУО «Ваверская средняя школа»",
      "addr" : "Гродненская область, агрогородок Ваверка Лидского  района, улица Молодежная, дом 6а.",
      "time" : "Время работы – понедельник-пятница с 8.00 до 15.30, суббота с 8.30 до  12.00",
      "phones" : "Координаты контактного лица -Андрукович Антонина Константиновна 8(0154)571292, МТС (29)2790133, sch_wawerka@tut/by.",
      "lat" : 53.8379104347,
      "tree" : "Объект",
      "type" : 3916,
      "place" : "Лида",
      "txt" : "<p>На базе школы выполняются исследовательские работы&nbsp;</p>\n\n<p>Ведется просветительская работа</p>\n\n<p>- Изучение теоретического курса &laquo;Юный следопыт&raquo;, &laquo;Лесоведение&raquo;;</p>\n\n<p>- Организация и проведение &nbsp;творческих&nbsp; конкурсов в школе, участие в районных, областных конкурсах;</p>\n\n<p>- Выпуск органа стенной печати школьного лесничества&nbsp;&nbsp;&nbsp; &laquo;Эколог&raquo;.</p>\n\n<p><strong>-</strong>Экологическая тропа</p>\n\n<p>&nbsp; На основе инвентаризации создана&nbsp; экологическая тропа. Здесь в осенне-зимний период школьники знакомятся с особенностями произрастания деревьев и кус&shy;тарников, их биологией и значением в жизни человека, а в мае и в период летней практики &mdash; с многообразием травянистых растений. Ведутся наблюдения за представителями животного мира. Работа на экологической тропе затем продолжается в классе по заданиям.</p>\n\n<p>&nbsp;Экологическая тропа включает биологические объекты, архитектурные сооружения, интересные природные объекты.</p>\n",
