      "act" : "биологический заказник местного значения",
      "lon" : 23.66745392602,
      "id" : 92907,
      "txt" : "<p>СОПОЦКИНСКИЙ, биологический заказник респ. значения в Гродненском р-не. Создан в 1978 для охраны природных запасов лекарственных растений, ландшафтных и флористических комплексов с редкими и исчезающими видами. Площадь 12,6 тыс. га (2006). Занимает лесной массив, в котором преобладают сосняки. Изредка встречаются ельники, березняки, черноольша-ники. Выделены редкие ландшафтные природные комплексы: участок ленточных липняков, пойменных дубрав и грабняков, сосняков на коренном берегу р. Неман и др. Лекарственные растения: толокнянка, брусника, можжевельник, ландыш майский и др. Арника горная, прострел луговой, многоножка обыкновенная, лютик едкий и др. включены в Красную книгу Беларуси; из представителей фауны &mdash; барсук, аист чёрный, махаон и др. Объект экологического туризма.</p>\n",
