      "act" : "геологический памятник природы местного значения",
      "place" : "Витебск",
      "txt" : "<p>Суражские обнажения&quot; состоит из шести обособленных участков, расположенных как непосредственно на территории городского поселка Сураж, так и в его окрестностях, по берегам рек Западная Двина, Каспля, Усвяча.<br />\nПлощадь памятника природы: 7,85 гектара.</p>\n\n<p>Описание границ памятника природы:</p>\n\n<p>1. Обнажение &quot;Черный берег&quot;, площадью 0,88 гектара, расположен в юго-западном направлении от деревни Поречье, в юго-восточном направлении от деревни Тарасенки.</p>\n\n<p>Граница:</p>\n\n<p>на севере проходит по землям открытого акционерного общества &quot;Витебская бройлерная птицефабрика&quot; (далее - ОАО &quot;Витебская бройлерная птицефабрика&quot;);</p>\n\n<p>на востоке проходит по границе с рекой Западная Двина;</p>\n\n<p>на юге проходит по границе с рекой Западная Двина;</p>\n\n<p>на западе проходит по землям ОАО &quot;Витебская бройлерная птицефабрика&quot;.</p>\n\n<p>2. Обнажение &quot;Борисова гора&quot;, площадью 0,47 гектара, расположен в юго-восточном направлении деревни Поречье, в северо-западной границе реки Западная Двина.</p>\n\n<p>Граница:</p>\n\n<p>на севере проходит по землям деревни Поречье;</p>\n\n<p>на востоке проходит по границе с рекой Западная Двина;</p>\n\n<p>на юге проходит по границе с рекой Западная Двина;</p>\n\n<p>на западе по землям деревни Поречье.</p>\n\n<p>3. Обнажение &quot;Дричалуки&quot;, площадью 0,34 гектара, расположен в юго-восточном направлении от деревни Прудники, в северо-восточном направлении от деревни Поречье.</p>\n\n<p>Граница:</p>\n\n<p>на севере проходит по землям ОАО &quot;Витебская бройлерная птицефабрика&quot;;</p>\n\n<p>на востоке проходит по землям ОАО &quot;Витебская бройлерная птицефабрика&quot;;</p>\n\n<p>на юге проходит по границе с рекой Усвяча;</p>\n\n<p>на западе проходит по землям ОАО &quot;Витебская бройлерная птицефабрика&quot;.</p>\n\n<p>4. Обнажение &quot;Слобода Двинская&quot;, площадью 1,32 гектара, расположен в восточном направлении деревни Прудники, в южном направлении от деревни Галиново, в северо-западной границе реки Западная Двина.</p>\n\n<p>Граница:</p>\n\n<p>на севере проходит по землям ОАО &quot;Витебская бройлерная птицефабрика&quot; и по границе с рекой Западная Двина;</p>\n\n<p>на востоке проходит по границе с рекой Западная Двина;</p>\n\n<p>на юге проходит по границе с рекой Западная Двина и по землям ОАО &quot;Витебская бройлерная птицефабрика&quot;;</p>\n\n<p>на западе проходит по землям ОАО &quot;Витебская бройлерная птицефабрика&quot;.</p>\n\n<p>5. Обнажение &quot;Шапурово&quot;, площадью 3,49 гектара, расположен в северо-восточном направлении от деревни Большая Любщина, в западном направлении от городского поселка Сураж.</p>\n\n<p>Граница:</p>\n\n<p>на севере проходит по границе с рекой Западная Двина;</p>\n\n<p>на востоке проходит по границе с рекой Западная Двина;</p>\n\n<p>на юге проходит по границе квартала N 90 Суражского лесничества Витебского государственного лесохозяйственного учреждения;</p>\n\n<p>на западе проходит по границе квартала N 90 Суражского лесничества Витебского государственного лесохозяйственного учреждения.</p>\n\n<p>6. Обнажение &quot;Дисняниново&quot;, площадью 1,35 гектара, расположен в южном направлении деревни Шапурово, в северо-западном направлении от деревни Каспляны, и с востока на запад по границе геологического памятника природы &quot;Суражкие обнажения&quot; проходит граница реки Западная Двина.</p>\n\n<p>Граница:</p>\n\n<p>на севере проходит по землям коммунального унитарного сельскохозяйственного предприятия &quot;Экспериментальная база им. Шмырева&quot; (далее - КУСХП &quot;Экспериментальная база им. Шмырева&quot;);</p>\n\n<p>на востоке проходит по землям КУСХП &quot;Экспериментальная база им. Шмырева&quot;;</p>\n\n<p>на юге проходит по границе с рекой Западная Двина;</p>\n\n<p>на западе проходит по землям КУСХП &quot;Экспериментальная база им. Шмырева&quot;.</p>\n"
