      "tree" : "Объект",
      "type" : 3916,
      "place" : "Витебск ",
      "txt" : "<p>Лужеснянский дендропарк занимает площадь 8,8 га в междуречье Западной Двины и устьевой части правого берега реки Лужеснянки. В планировке сочетаются регулярный и ландшафтный стиль. Территория разграничена на 9 секций дорожками и аллеями. В начале 1997 года здесь насчитывалось более 250 видов древесно-кустарниковых и 32 вида цветочных многолетних растений, в том числе занесенных в Красную книгу Беларуси.<br />\n<span id=\"bufferBlock\" style=\"color: rgb(0, 0, 0); font-family: Arial, Helvetica, sans-serif; font-size: 13.05px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; height: 1px; overflow: hidden; position: absolute; width: 1px; margin: 5px 0px 0px -1px; line-height: 0; opacity: 0; background-color: rgb(242, 242, 242);\">Читать полностью:&nbsp;<a href=\"http://news.tut.by/society/403301.html\" style=\"margin: 0px; padding: 0px; border: 0px; font-size: 13.05px; font-family: inherit; color: rgb(25, 44, 143); text-decoration: underline; line-height: inherit; font-weight: inherit;\">http://news.tut.by/society/403301.html</a></span></p>\n",
