      "txt" : "<p>&laquo;Дымовщина&raquo;&ndash; биологический (орнитологический) заказник местного значения. Расположен в Витебском районе в 3-х км к западу от Витебска на территории летчанского лесничества кв. 123-124. . Создан в 1979 году для охраны уникальных сообществ птиц на заросших торфяных карьерах на весте верхового болота. Площадь 159 гектаров. На территории заказника гнездится 61 вид птиц, в том числе промысловые (водоплавающие, кулики), охраняемые и редкие пустельга обыкновенная (Falco tinnunculus) , дербник (Falco columbarius) , большая выпь (Botaurus stellaris), ремез обыкновенный (Remiz pendulinus), чайка малая (Larus minutus) , общей численностью около 1,5 тысяч пар. В заказнике ведутся научные наблюдения.</p>\n",
