      "id" : 92897,
      "txt" : "<p>&laquo;Придвинье&raquo;&ndash; биологический заказник местного значения. Расположен Витебском районе, в 15-и км на запад от Витебска, в пойме реки Шевинка на территории Летчанского лесничества ГЛХУ &laquo;Витебский лесхоз&raquo; кв. 163,175,176,182,183,184,185. Создан в 1985 году для охраны ценных насаждений (пойменная дубрава) и редких растений. Площаль 233 гектар, рельеф холмисто-равнинный. В растительном покрове преобладают сосняки (мшистый, черничный, орляковый, багульникомый) и пойменные луголисохвостные луга. Из растений внесенных в Красную книгу БССР произрастают баранец обыкновенный (Planta Tartarica Barometz),безвременник осенний (C&oacute;lchicum autumn&aacute;le), венерин башмачок настоящий (Cypripedium calceolus), водосбор обыкновенный (Aquil&eacute;gia vulg&aacute;ris), дремлик темнокрасный (Epipactis atrorubens) , касатик сибирский (Iris sibirica), колокольчик персиколистный (Camp&aacute;nula persicif&oacute;lia), наперстянка крупноцветковая (Digit&aacute;lis grandifl&oacute;ra), линнея северная (Linnaea borealis), шпажник черепитчатый, ятрышник мужской (Orchis mascula), ятрышник шлемоносный (&Oacute;rchis milit&aacute;ris), а так же лекарственные растения - окопник лекарственный (Symphytum officinale) , толокнянка обыкновенная (Arctostaphylos uva-ursi), Здесь произрастают редкие для области растения: астрагал датский (Astragalus hypoglottis), дремлик болотный (Epipactis palustris) , девясил иволистный (Inula salicina), полуница (Fragaria viridis), тайник яйцевидный (List&eacute;ra ov&aacute;ta) , ужовник обыкновенный (Ophioglossum vulgatum), фиалка высокая (Viola odorata).</p>\n",
      "place" : "Витебск"
