      "lat" : 53.4579208965649,
      "txt" : "<p>Эксплуатирующая организация: РУП &laquo;Гродноэнерго&raquo;.</p>\n\n<p>Дата ввода в эксплуатацию: введена в 1953 г., принята на баланс РУП &quot;Гродноэнерго&quot; от Дятловского райисполкома в 1997 г.</p>\n\n<p>Мощность: 0,22 МВт.</p>\n\n<p>Марка и производитель оборудования: асинхронный генератор АСВГ-110 (2 шт.) &laquo;Уралгидромаш&raquo;, г. Сысерть.</p>\n\n<p>Годовая выработка электроэнергии<span style=\"color: rgb(0, 0, 0); font-family: Roboto, Arial, sans-serif; font-size: 13px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 300; letter-spacing: normal; line-height: normal; orphans: 2; text-align: -webkit-left; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; display: inline !important; float: none; background-color: rgb(255, 255, 255);\">: 976,8 тыс.кВтч.</span></p>\n\n<p>Объем выработки электроэнергии за 1 полугодие 2016 г.: 355 тыс. кВтч.</p>\n\n<p>&nbsp;</p>\n",
