      "act" : "зоологический заказник местного значения",
      "id" : 92874,
      "txt" : "<p>Заказник &laquo;Барбастелла&raquo; создан на территории одного из фортификационных сооружений для сохранения мест обитания и зимовок редких видов летучих мышей. Это единственный в нашей стране заказник подобного рода. В заброщенных фортах Брестской крепости в последнее десятилетие XX века образовалась самая крупнейшая в Республики Беларусь и в Европе массовая зимовка рукокрылых.<br />\n<br />\nЕжегодно, за сезон (ноябрь-март) здесь пребывает свыше 2500 особей рукокрылых 12 видов - широкоушка европейская, ночница Наттерера, ночница прудовая, кожанок северный, ночница водяная, ушан бурый, ушан серый, кожанок поздний и другие.</p>\n\n<p>Территория представляет собой полностью искусственно перепрофилированную местность с относительными превышениями высот до 15 м. Основные черты местности сформировались в 1912 - 1915 гг. в ходе модернизации оборонительного форта № 8, второго пояса фортов Брестской крепости, и создание на его основе более совершенного форта А. Форт представляет собой два крупных двух уровневых казематных подземных укрытия общей площадью более 1 тыс. М2: северный каземат и южный каземат. Стены и своды казематов строились из кирпича и армированного бетона, потолочные своды на некоторых участках перекрывались арочными и двутавровыми стальными балками. Снаружи казематы укрыты грунтом до 3 метров толщины. По периметру Форт опоясан рвом шириной 5-20 метров в юго-западной части заболоченный. Восточная часть рва не сохранилась из-за карьерных земляных работ.</p>\n\n<p>После 1 мировой войны помещения форта использовались в качестве интендантских складов польской армией. В послевоенный период здания занимались различными подразделениями Советской армии. В 90-е годы прошлого века вплоть до распада Совесткого Союза здесь дислоцировались подразделения зенитно-ракетной бригады.</p>\n\n<p>форты<br />\nПосле вывода подразделения в безхозных сооружениях сформировался пещерный микроклимат: высокая влажность &mdash; до 95 процентов, и плюсовая температура в 1 &mdash; 5 градусов, благоприятный для зимовки большинства наших видов рукокрылых.</p>\n\n<p>Внешняя поверхность заказника покрыта преимущественно древесной растительностью с преобладанием клена ясенелистного и робинии псевдоакации. Встречаются: ясень обыкновенный, дуб черешчатый, липа, ива, вяз. Здесь же произрастает самая большая в Беларуси популяция самого маленького в мире растения &ndash; вольфии. Живой напочвенный покров представлен 212 видами высших сосудистых растений. На этом сравнительно небольшом участке выявлены: 31 вид млекопитающих, около 100 видов птиц, в том числе зимородок и зеленый дятел. Здесь также обитает 2 вида рептилий и 8 амфибий. На территории &laquo;Барбастеллы&raquo; есть уникальные виды земноводных, моллюсков.</p>\n\n<p>Наибольшую ценность представляют зимующие здесь охраняемые виды рукокрылых: ночница прудовая &ndash; II категория Красной книги, ночница Наттерера &ndash; IV категория Красной книги, широкоушка европейская &ndash; II категория Красной книги, кожанок северный - II категория Красной книги. Наиболее массовым видом на зимовке является широкоушка европейская.</p>\n",
