      "txt" : "<div class=\"prop\" style=\"margin: 0px; padding: 0px; font-family: Arial, Helvetica, sans-serif; border: 0px; outline: 0px; font-size: 16px; vertical-align: baseline; color: rgb(45, 23, 10); font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal; letter-spacing: normal; line-height: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background: rgb(255, 255, 255);\">\n<div style=\"margin: 0px; padding: 0px 30px; font-family: Arial, Helvetica, sans-serif; border: 0px; outline: 0px; font-size: 16px; vertical-align: baseline; line-height: 1.45em; font-weight: bold; color: rgb(181, 113, 61); background: transparent;\">Ландшафтный заказник &laquo;Сорочанские озера&raquo; площадью 14 738,97 га представляет собой природный комплекс, считающийся типичным для Белорусского Поозерья. Его сложный рельеф с преобладанием камовых и озовых холмов имеет ледниковое происхождение.</div>\n</div>\n\n<div class=\"descr\" style=\"margin: 0px; padding: 0px; font-family: Arial, Helvetica, sans-serif; border: 0px; outline: 0px; font-size: 16px; vertical-align: baseline; color: rgb(45, 23, 10); font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal; letter-spacing: normal; line-height: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background: rgb(255, 255, 255);\">\n<div style=\"margin: 0px; padding: 16px 30px 0px; font-family: Arial, Helvetica, sans-serif; border: 0px; outline: 0px; font-size: 16px; vertical-align: baseline; line-height: 1.45em; background: transparent;\">\n<p style=\"margin: 0px; padding: 0px 0px 16px; font-family: Arial, Helvetica, sans-serif; border: 0px; outline: 0px; font-size: 16px; vertical-align: baseline; line-height: 1.45em; background: transparent;\">На территории заказника расположены озера Клевей, Тумское, Голодзянка, Иодово и другие. Для них характерно слабое перемешивание воды, которая из-за этого содержит мало кислорода. В целом озера отличаются живописностью, что привлекает к ним внимание туристов.</p>\n\n<p style=\"margin: 0px; padding: 0px 0px 16px; font-family: Arial, Helvetica, sans-serif; border: 0px; outline: 0px; font-size: 16px; vertical-align: baseline; line-height: 1.45em; background: transparent;\">Две трети территории покрыто лесами, где доминирует сосна, также встречаются черноольшаники, которые приурочены к берегам водоемов. На долю болот и суходольных лугов приходится лишь 15%. В заказнике &laquo;Сорочанские озера&raquo; обитают 11 видов растений и 22 вида животных, находящихся под защитой Красной книги Беларуси.</p>\n</div>\n</div>\n",
