      "lat" : 53.8824913466,
      "type" : 3916,
      "tree" : "Объект",
      "place" : "Минск",
      "txt" : "<p style=\"margin: 0.5em 0px; line-height: 22.4px; color: rgb(37, 37, 37); font-family: sans-serif; font-size: 14px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);\">Парк примыкает к территории <a href=\"https://ru.wikipedia.org/wiki/%D0%9C%D0%B8%D0%BD%D1%81%D0%BA%D0%B8%D0%B9_%D1%82%D1%80%D0%B0%D0%BA%D1%82%D0%BE%D1%80%D0%BD%D1%8B%D0%B9_%D0%B7%D0%B0%D0%B2%D0%BE%D0%B4\" style=\"text-decoration: none; color: rgb(11, 0, 128); background: none;\" title=\"Минский тракторный завод\">МТЗ</a> и поэтому значительно влияет на экологию прилегающих районов. Рядом с парком находится <a class=\"mw-redirect\" href=\"https://ru.wikipedia.org/wiki/%D0%A1%D1%82%D0%B0%D0%B4%D0%B8%D0%BE%D0%BD_%D0%A2%D1%80%D0%B0%D0%BA%D1%82%D0%BE%D1%80_(%D0%9C%D0%B8%D0%BD%D1%81%D0%BA)\" style=\"text-decoration: none; color: rgb(11, 0, 128); background: none;\" title=\"Стадион Трактор (Минск)\">стадион Трактор</a>.</p>\n\n<p style=\"margin: 0.5em 0px; line-height: 22.4px; color: rgb(37, 37, 37); font-family: sans-serif; font-size: 14px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);\">В парке произрастают деревья преимущественно хвойных пород.</p>\n",
