      "txt" : "<p style=\"margin: 0px 0px 1em; padding: 0px; border: 0px; color: rgb(0, 0, 0); font-family: Arial, sans-serif; font-size: 11.52px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal; letter-spacing: normal; line-height: normal; orphans: 2; text-align: justify; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);\">В ХIХ веке на месте парка рос сосновый лес, принадлежавший представителям знаменитого шляхетского рода Ваньковичей. Проложенная немцами для вывоза леса узкоколейка после войны превратилась в Детскую железную дорогу. Короткое путешествие в маленьких вагончиках вызывает бурный восторг у детворы.</p>\n\n<p style=\"margin: 0px 0px 1em; padding: 0px; border: 0px; color: rgb(0, 0, 0); font-family: Arial, sans-serif; font-size: 11.52px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal; letter-spacing: normal; line-height: normal; orphans: 2; text-align: justify; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);\">На территории парка работают различные аттракционы.</p>\n",
