      "txt" : "<p>Опыт реализации проектов по различным направлениям: ландшафтно-экологических, эколого-образовательных, волонтёрских, социально-экологического и др.В стадии разработки эколого-этнографический проект в сфере экотуризма (ищем партнёров и спонсоров).</p>\n\n<p>Опыт организации работы по энергосбережению (просветительская, практическая деятельность, образовательные, интерактивные занятия с учащимися), экологического образования учащихся и педагогов с использованием территории учреждения, проведение мастер-классов с использованием природных материалов.</p>\n\n<p>Реализуем масштабные конкурсы и акции с учащимися на уровне Лидского района преимущественно имеющие практический &laquo;выход&raquo; (например, &laquo;Авоська вместо маечки&raquo;, &laquo;Сдай батарейку &ndash; помоги природе!&raquo;, конкурс на самое креативное огородное пугало из вторичных материалов и т.д.)</p>\n\n<p>Проводим экскурсии по учебному эколого-биологическому комплексу, где реализовано 8 проектов. Ищем спонсоров для оформления эколого-этнографической тропы.</p>\n\n<p>Имеем потенциал для создания информационного центра по экологическому просвещению, визит-центра по энергосбережению.</p>\n\n<p>Работаем над документацией учебной фирмы &laquo;Отходы в доходы&raquo;</p>\n\n<p><u>Центр является пунктом приёма отработанных элементов питания (батареек) с 2012 года</u>, налажено сотрудничество с фирмой, осуществляющей их централизованный вывоз.</p>\n",
