      "txt" : "<p><span style=\"color: rgb(0, 0, 0); font-family: Arial, Tahoma, sans-serif; font-size: 12.8px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal; letter-spacing: normal; line-height: 19.2px; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; display: inline !important; float: none; background-color: rgb(255, 255, 255);\">Расположен в южной части города, на границе жилой застройки </span><i style=\"font-size: 12.8px; color: rgb(0, 0, 0); font-family: Arial, Tahoma, sans-serif; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal; letter-spacing: normal; line-height: 19.2px; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);\">Заднепровского жилого района</i><span style=\"color: rgb(0, 0, 0); font-family: Arial, Tahoma, sans-serif; font-size: 12.8px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal; letter-spacing: normal; line-height: 19.2px; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; display: inline !important; float: none; background-color: rgb(255, 255, 255);\"> (Октябрьский р-н), на пересечении улиц Островского, Симонова и пр. Шмидта. Заложен в 1977 в честь 60-й годовщины Октябрьской революции трудящимися и молодёжью Октябрьского р-на города. Пл. 82 га. Высажено ок. 4,5 тыс. деревьев и 3 тыс. кустарников. Произрастают рябина обыкновенная, липа мелколистная, клён остролистный, дуб обыкновенный (черешчатый), ясень, тополь канадский, берёза пушистая, ива плакучая, каштан конский, черёмуха. В парке оборудована &laquo;тропа здоровья&raquo;.</span></p>\n"
