      "lat" : 52.409263333,
      "txt" : "<p style=\"margin: 0px 0px 15px; color: rgb(0, 0, 0); font-family: &quot;Trebuchet MS&quot;, Verdana, Arial, sans-serif; font-size: 15px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal; letter-spacing: normal; line-height: 24px; orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; text-align: justify; background-color: rgb(255, 255, 255);\">арк Фестивальный расположен в западной части города (<a href=\"http://gomelstreet.info/rajony-gomelya/sovetskij-rajon/\" style=\"text-decoration: none; color: rgb(131, 184, 122);\" title=\"Советский район Гомеля\">Советский район</a>), ограничен улицами<a href=\"http://gomelstreet.info/ulicy-goroda-gomel/mezhdugorodnyaya-ulica/\" style=\"text-decoration: none; color: rgb(131, 184, 122);\" title=\"Междугородняя, улица\">Междугородной</a>, <a href=\"http://gomelstreet.info/ulicy-goroda-gomel/volgogradskaya-ulica/\" style=\"text-decoration: none; color: rgb(131, 184, 122);\" title=\"Волгоградская, улица\">Волгоградской</a>, <a href=\"http://gomelstreet.info/ulicy-goroda-gomel/rechickij-prospekt/\" style=\"text-decoration: none; color: rgb(131, 184, 122);\" title=\"Речицкий, проспект\">Речицким проспектом</a>. Площадь 32,1 га. Заложен в 1968 г. в честь 25-летия Победы советского народа в Великой Отечественной войне. Часть бывшего Назаровского леса.</p>\n\n<p style=\"margin: 15px 0px; color: rgb(0, 0, 0); font-family: &quot;Trebuchet MS&quot;, Verdana, Arial, sans-serif; font-size: 15px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal; letter-spacing: normal; line-height: 24px; orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; text-align: justify; background-color: rgb(255, 255, 255);\">Представляет собой единый массив, состоящий из 2 частей: западной &ndash; мемориальной (площадью 6,9 га) и восточной &ndash; спортивной. Центр композиции &ndash; курган Славы, к которому от Речицкого проспекта ведёт аллея, окаймлённая живой изгородью и подчёркнутая цветочной рабаткой. Посадки вновь создаваемых насаждений (тополь Симона, ива волнистая, рябина обыкновенная), небольшие водоёмы придают парку особую живописность.</p>\n\n<p style=\"margin: 15px 0px; color: rgb(0, 0, 0); font-family: &quot;Trebuchet MS&quot;, Verdana, Arial, sans-serif; font-size: 15px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal; letter-spacing: normal; line-height: 24px; orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; text-align: justify; background-color: rgb(255, 255, 255);\"><span style=\"color: rgb(0, 0, 0); font-family: &quot;Trebuchet MS&quot;, Verdana, Arial, sans-serif; font-size: 15px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal; letter-spacing: normal; line-height: 24px; orphans: 2; text-align: justify; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; display: inline !important; float: none; background-color: rgb(255, 255, 255);\">В парке есть пруд, танцевальная площадка, деревянные фигуры сказочных героев, Курган славы, церковь Святого Архистратига Михаила.</span></p>\n",
