      "txt" : "<p><span style=\"color: rgb(0, 0, 0); font-family: arial, verdana, sans-serif; font-size: 13px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal; letter-spacing: normal; line-height: 20px; orphans: 2; text-align: justify; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; display: inline !important; float: none; background-color: rgb(255, 255, 255);\">Парк заложен был частично уже в конце XVIII в. Согласно планам Занеманской части Гродно 1797 г., эти земли принадлежали Радзивиллам. Следующим владельцем этих земель был Игнатий Ляхницкий. В 1828 г. часть земли перешла к Якову Румелю и с этого времени усадьба в документах упоминается как &laquo;Румлевка&raquo;. При Игнатии Лехницком и Якове Румеле складывался современный вид лесопарка Румлево. </span><br style=\"color: rgb(0, 0, 0); font-family: arial, verdana, sans-serif; font-size: 13px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal; letter-spacing: normal; line-height: 20px; orphans: 2; text-align: justify; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);\" />\n<span style=\"color: rgb(0, 0, 0); font-family: arial, verdana, sans-serif; font-size: 13px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal; letter-spacing: normal; line-height: 20px; orphans: 2; text-align: justify; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; display: inline !important; float: none; background-color: rgb(255, 255, 255);\">После отъезда Румеля в Пинск владельцем лесопарка стал помещик Константин Видацкий, муж Франциски Видацкой, матери Элизы Ожешко. После смерти мужа Франциска Видацкая стала владелицей имения и парка. После возвращения из Варшавы в 1857 г. Элиза Ожешко часто бывала у матери в Румлево. После смерти матери Элиза Ожешко продала земли отставному генералу Александру Васильковскому. Вдова генерала Васильковского передала часть лесопарка военному ведомству. В 1877 г. здесь был разбит летний лагерь 26-й пехотной дивизии. В последующие годы вся часть Румлево перешла военным.&nbsp;</span><br style=\"color: rgb(0, 0, 0); font-family: arial, verdana, sans-serif; font-size: 13px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal; letter-spacing: normal; line-height: 20px; orphans: 2; text-align: justify; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);\" />\n<span style=\"color: rgb(0, 0, 0); font-family: arial, verdana, sans-serif; font-size: 13px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal; letter-spacing: normal; line-height: 20px; orphans: 2; text-align: justify; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; display: inline !important; float: none; background-color: rgb(255, 255, 255);\">В районе д. Солы во времена Российской империи существовала паромная переправа, а в середине 30-х гг. XX в. польскими военными был построен деревянный мост. Накануне Великой Отечественной войны в Румлевском лагере дислоцировались части 85-й Челябинской стрелковой дивизии. Во время оккупации города здесь находился лагерь для военнопленных красноармейцев. После 1945 г. на одной части территории парка разместился детский оздоровительный лагерь, принадлежавший военному ведомству, а на другой &ndash; летняя база военных частей. В 1980-х гг. началось строительство микрорайона Румлево. В 1990 г. в юго-западной части была построена гимназия № 1. В 1993 г. решением Гродненского городского Совета депутатов лесопарк Румлево был объявлен памятником природы местного значения.</span><br style=\"color: rgb(0, 0, 0); font-family: arial, verdana, sans-serif; font-size: 13px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal; letter-spacing: normal; line-height: 20px; orphans: 2; text-align: justify; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);\" />\n<span style=\"color: rgb(0, 0, 0); font-family: arial, verdana, sans-serif; font-size: 13px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal; letter-spacing: normal; line-height: 20px; orphans: 2; text-align: justify; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; display: inline !important; float: none; background-color: rgb(255, 255, 255);\">Парк включает в себя черты как регулярного, так и пейзажного парка, он интересен биологам, которые исследуют здесь богатый животный и растительный мир, в том числе редкие виды. Парк привлекает внимание ученых своим естественным ландшафтным разнообразием в сочетании с остатками старинных аллей. Интересен парк и палеонтологам, обнаружившим стоянку каменного века, и историкам. В северо-западной части парка сохранилась шатровая башня из бутового камня. По некоторым сведениям она возведена была в 1880 г., а по другим &ndash; в 1930-х гг. Парк является памятником садово-паркового искусства.</span></p>\n",
