      "txt" : "<p style=\"margin: 0px 0px 30px; padding: 0px; color: rgb(0, 0, 0); font-family: roboto; font-size: 19px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 300; letter-spacing: normal; line-height: 32px; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);\">Парк был заложен в конце 40-х годов ХХ века. Расположен между улицей М. Горького и рекой Зап. Двиной. Площадь парка &mdash; 3 га. Главная аллея заканчивается спуском к речному пляжу.</p>\n\n<p style=\"margin: -17px 0px 30px; padding: 0px; color: rgb(0, 0, 0); font-family: roboto; font-size: 19px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 300; letter-spacing: normal; line-height: 32px; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);\">Парк был создан работниками фабрики имени КИМ в 1940-х годах, а реконструирован в 1950-х. Дворец спорта &laquo;<a href=\"https://vitebsk.biz/sport-clubs/komsomolec/\" style=\"outline: none; color: rgb(0, 102, 255); text-decoration: none;\">Комсомолец</a>&raquo; находится на северной окраине парка.</p>\n",
