      "place" : "Гродно",
      "txt" : "<p style=\"text-align: justify;\">В настоящее время центр находится в восточной части города, занимая второй этаж в здании по ул.Антонова, 20.<br />\n&nbsp;Центр&nbsp;&ndash; это удивительный мир творчества, детской фантазии и педагогического поиска. Используя слово, знания, умения, красоту, доброту, педагоги центра создают условия, в которых ребенок лучшим образом может проявить и реализовать свои творческие возможности, найти новые интересные увлечения, почувствовать себя востребованным и интересным.</p>\n\n<p style=\"text-align: justify;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Работа методической службы осуществляется в условиях активного внедрения инноваций в области воспитания, поиска новых методов, технологий, переосмысления приоритетных направлений содержания работы УДОДиМ.<br />\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Задачи экологического воспитания и обучения успешно решает учебно-экологический комплекс. В его состав входят учебно-опытный участок, угодок живой природы, музей природы, выставочный зал.</p>\n\n<p style=\"text-align: justify;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Существенную роль в формировании научных основ экологического образования школьников играет опытническая и исследовательская деятельность, в ходе которой учащиеся приобщаются к пониманию многих экологических проблем, у детей появляется ответственность за состояние окружающей среды, за живой и растительный мир.</p>\n\n<p style=\"text-align: justify;\">В вихре полезных, интересных дел, в мире творчества и фантазии, игры и красоты, в союзе взрослых и детей проходят будни и праздники Центра:</p>\n\n<ul>\n\t<li>\n\t<div style=\"text-align: justify;\"><em>Фольклорные и обрядовые:&nbsp; &laquo;Цуд зiмовы - Каляда&raquo;, &laquo;Кола года&raquo;, &laquo;Багач&raquo;, &laquo;Саракi&raquo;</em></div>\n\t</li>\n\t<li>\n\t<div style=\"text-align: justify;\"><em>Конкурсы:&nbsp; детских рисунков и фотографий, &laquo;Юннат года&raquo;, &laquo;Сокровища родного края&raquo;</em></div>\n\t</li>\n\t<li>\n\t<div style=\"text-align: justify;\"><em>Фестивали:&nbsp; &laquo;Юных ботаников&raquo;, &laquo;Юных аранжировщиков&raquo;, &laquo;Юных флористов&raquo;</em></div>\n\t</li>\n\t<li>\n\t<div style=\"text-align: justify;\"><em>Слеты: &laquo;Юных экологов&raquo;, &laquo;Юных лесоводов&raquo;Акции: &laquo;День земли&raquo;, &laquo;Малым рекам &ndash; большую заботу&raquo;,&nbsp; &laquo;Поможем зимующим птицам&raquo;, &laquo;Очистим планету от мусора&raquo;, &laquo;Зачем нам Чернобыль в кармане&raquo;.</em></div>\n\t</li>\n</ul>\n\n<p style=\"text-align: justify;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Развитие творческого потенциала детей и молодежи, повышение уровня культурного и нравственного развития, воспитания экологической культуры и потребности в здоровом образе жизни &ndash; основные направления воспитательно-образовательной деятельности, которые реализуются в программе развития центра</p>\n",
