      "txt" : "<p><span style=\"color: rgb(0, 0, 0); font-family: Verdana, Arial, Tahoma, sans-serif; font-size: 12px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal; letter-spacing: normal; line-height: normal; orphans: 2; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; display: inline !important; float: none; background-color: rgb(255, 255, 255);\">Общие цели подготовки специалиста по специальности </span></p>\n\n<h2 align=\"center\" style=\"color: rgb(74, 133, 67); font-size: 14px; line-height: 14px; font-weight: bold; font-family: Verdana, Arial, Tahoma, sans-serif; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; letter-spacing: normal; orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);\">Экология сельского хозяйства<br />\nКвалификация Эколог</h2>\n\n<ul style=\"font-size: 12px; font-family: Verdana, Arial, Tahoma, sans-serif; color: rgb(0, 0, 0); font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal; letter-spacing: normal; line-height: normal; orphans: 2; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);\">\n\t<li>ответственность профессионалов, как специалистов, владеющих экологической информацией и имеющих возможность влиять на принятие жизненно важных решений для конкретных территорий;</li>\n\t<li>формирование знаний о современном состоянии биосферы и ее отдельных компонентах в условиях техногенного загрязнения поллютантами;</li>\n\t<li>теоретическая и практическая подготовка специалистов по предметам в области экологии и радиоэкологии, мониторинга окружающей среды, сельскохозяйственной радиологии, предназначенных для решения экологических проблем в сельскохозяйственной отрасли;</li>\n\t<li>формирование и развитие социально-профессиональной компетентности, позволяющей сочетать академические, профессиональные, социально-личностные компетенции для решения задач в сфере профессиональной и социальной деятельности в области экологии;</li>\n\t<li>развитие экологического мышления на основе системы ценностных ориентаций устойчивого развития современного природопользования в целях правильного решения природоохранных и ресурсных проблем в сфере сельского хозяйства;</li>\n\t<li>формирование активной профессиональной деятельности, постановки задач, выработки и принятия решений, планирования и организации обеспечения деятельности с учетом их социальных, экологических и экономических последствий;</li>\n\t<li>формирование навыков исследовательской работы и экспериментирования в сельском хозяйстве, научного анализа опытных результатов, творческого применения научных достижений в практике сельского хозяйства.</li>\n</ul>\n",
