      "txt" : "<p>Организация занимается практическими вопросами охраны природы и экологического образования молодёжи;</p>\n\n<p>проведением кампаний на локальном и региональном уровнях, обмен информацией, передача информации СМИ и структурам управления</p>\n\n<p>участие в создании охраняемых природных территорий (заказников)&nbsp;</p>\n\n<p>- дают рекомендации по ведению&nbsp; органческого&nbsp; сельского&nbsp; хозяйства, выращиванию&nbsp; ягодников,&nbsp; лекарственных растений и рациональному&nbsp; использованию земель.</p>\n",
