      "txt" : "<p>Центр призван стать учебно-методической и научно-исследовательской базой, обеспечивающей повышение качества преподавания дисциплин эколого-природоведческого направления и проведения экологического просвещения.</p>\n\n<p>Центр состоит из&nbsp; 2-х отделов: &laquo;Ботанические экспозиции&raquo;, &laquo;Агробиология&raquo;.</p>\n\n<p>В настоящее время&nbsp; Центр экологии выполняет следующие задачи:</p>\n\n<p>1. Учебно-образовательно-познавательная. На основе многообразия оранжерейных растений, растений открытого грунта, живых объектов (птиц и рыб) проводятся учебные занятия со студентами различных факультетов университета. Кураторы студенческих групп организовывают проведение познавательно-ознакомительных экскурсий с целью закрепления теоретически сформированных навыков экологического воспитания и активизации внимания молодежи к вопросам познания и охраны окружающего мира. Посещать &laquo;Зимний сад&raquo; и &laquo;Сад непрерывного цветения&raquo; имеют возможность также дошкольники и учащиеся г. Бреста и области, как путем самоознакомления с миром природы в центре города, так и под руководством учителей (воспитателей) для изучения конкретных объектов, процессов, явлений развития растительного и животного мира. Экспозиции Центра позволяют наблюдать за живыми объектами в непосредственной близости, а также с разных точек обзора.</p>\n\n<p>2. Учебно-научно-методическая. На основе наблюдения, исследования живых объектов экспозиций и наглядных материалов в Центре проводятся не только учебные занятия, заседания научных секций со студентами университета, но и научно-методические семинары и консультации для работников учреждений образования, в рамках плановой работы методобъединений учителей географии, биологии и Института развития образования г. Бреста и области. Таким образом, становится возможным более тесное сотрудничество специалистов университета с работниками учреждений образования, представителями природоохранных и общественных экологических организаций. Разработаны и изданы массовым тиражом учебно-наглядные пособия эколого-природоведческого цикла на основе результатов собственных научных исследований биоразнообразия природы Брестской области.</p>\n\n<p>3. Научно-исследовательская. Сотрудниками Центра проведены работы в области изучения биоразнообразия и охраны природы Брестчины. Результаты работы явились основанием для организации заказников &laquo;Скоки&raquo; (1990 г.), &laquo;Ворохово&raquo; (1994 г.), &laquo;Бугский&raquo; (1999 г.). На базе Центра студенты выполняют курсовые и дипломные работы.</p>\n\n<p>4. Психолого-эстетическая. Экспозиции Центра выполняют функцию разносторонней и эффективной психоэмоциональной разгрузки и эстетического наслаждения, как для студентов, преподавателей, сотрудников, так и для детей, молодежи, а также взрослых посетителей &ndash; горожан и гостей г. Бреста.</p>\n\n<p>5. Содействие в создании ландшафтного озеленения территорий социально-значимых объектов г. Бреста. Сотрудники Центра &ndash; авторы многочисленных проектов и создатели комплексного и высоэстетического озеленения как интерьеров учебных корпусов университета, так и прилегающих к нему территорий. Сотрудниками Центра ежегодно проводятся городские научно-методические семинары и консультации для работников учреждений образования по вопросам ландшафтного озеленения. Разработаны и созданы проекты &laquo;Зимний сад&raquo; и дендропарк в Томашовской СШ Брестского района, разработаны проекты и оказана помощь посадочным материалом лицею №1, гимназии №1, 3 и ряду школ и садов г. Бреста и области,&nbsp; а также мемориальные объекты: &laquo;Курган Славы&raquo;, &laquo;Хатынь&raquo;, &laquo;Брестская крепость&raquo;, усадебно-парковый комплекс Немцевичей.</p>\n",
