      "txt" : "<p>Основные направления деятельности отделения:<br />\n&bull; содействие подготовке и координация проведения акций и кампаний АПБ на Брестчине;<br />\n&bull; участие в научных проектах и ​​акциях по изучению и охране птиц и биоразнообразия;<br />\n&bull; сотрудничество с учреждениями образования, СМИ, НПО ;<br />\n&bull; популяризация наблюдений за птицами (бёдуотчынгу) и экотуризма;<br />\n&bull; неформальное образование активных членов АПБ с Брестчины;<br />\n&bull; помощь в организационном развицци региональным группам и отделениям АПБ на Брестчине;<br />\n&bull; осуществление проектной финансовой деятельности на Брестчине;<br />\n&bull; информирование местных членов АПБ и общественности о деятельности отделения и АПБ.<br />\nПо любым вопросам обращайтеь к Абрамчуку Андрею или другим членам Совета.</p>\n\n<p>Совет отделения:<br />\nАбрамчук Андрей, председатель Совета отделения.<br />\nВолосюк Святослав, заместитель председателя Совета отделения.<br />\nАбрамчук Марина, член Совета отделения.<br />\nВахний Наталья, член Совета отделения.<br />\nДемчуку Юлия, член Совета отделения.<br />\nСербун Александр, член Совета отделения.<br />\nНефидович Анатолий, член Совета отделения.<br />\nЮрий Бакур, член ревизийнай комиссии.</p>\n",
