      "place" : "Гомель ",
      "txt" : "<p style=\"font-family: Arial, Verdana; font-size: 14px; font-style: normal; font-weight: normal; margin: 0px 0px 10px; padding: 0px; vertical-align: baseline; color: rgb(51, 51, 51); font-variant: normal; letter-spacing: normal; line-height: 20px; orphans: auto; text-align: justify; text-indent: 0px; text-transform: none; white-space: normal; widows: 1; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);\"><b>Цели и задачи</b></p>\n\n<p style=\"font-family: Arial, Verdana; font-size: 14px; font-style: normal; font-weight: normal; margin: 0px 0px 10px; padding: 0px; vertical-align: baseline; color: rgb(51, 51, 51); font-variant: normal; letter-spacing: normal; line-height: 20px; orphans: auto; text-align: justify; text-indent: 0px; text-transform: none; white-space: normal; widows: 1; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);\"><span style=\"font-family: inherit; font-size: 14px; font-style: inherit; font-weight: inherit; margin: 0px; padding: 0px; vertical-align: baseline; color: rgb(0, 0, 0);\">Организация надзора за соблюдением субъектами хозяйствования и гражданами санитарного законодательства, санитарных норм, правил и гигиенических нормативов, а также контроль за организацией и проведением ими мероприятий по предупреждению и снижению заболеваемости населения;</span><br />\n<span style=\"font-family: inherit; font-size: 14px; font-style: inherit; font-weight: inherit; margin: 0px; padding: 0px; vertical-align: baseline; color: rgb(0, 0, 0);\">Реализация мер по профилактике заболеваний путем предупреждения, выявления и пресечения нарушений санитарного законодательства и санитарных правил;</span><br />\n<span style=\"font-family: inherit; font-size: 14px; font-style: inherit; font-weight: inherit; margin: 0px; padding: 0px; vertical-align: baseline; color: rgb(0, 0, 0);\">Организация и ведение социально-гигиенического мониторинга за качеством среды обитания и состоянием здоровья населения в связи с воздействием неблагоприятных факторов окружающей среды и условий жизнедеятельности;</span><br />\n<span style=\"font-family: inherit; font-size: 14px; font-style: inherit; font-weight: inherit; margin: 0px; padding: 0px; vertical-align: baseline; color: rgb(0, 0, 0);\">Организационно-методическое руководство деятельностью ведомств по вопросам охраны здоровья населения и трудящихся;</span></p>\n\n<p style=\"font-family: Arial, Verdana; font-size: 14px; font-style: normal; font-weight: normal; margin: 0px 0px 10px; padding: 0px; vertical-align: baseline; color: rgb(51, 51, 51); font-variant: normal; letter-spacing: normal; line-height: 20px; orphans: auto; text-align: justify; text-indent: 0px; text-transform: none; white-space: normal; widows: 1; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);\"><span style=\"font-family: inherit; font-size: 14px; font-style: inherit; font-weight: inherit; margin: 0px; padding: 0px; vertical-align: baseline; color: rgb(0, 0, 0);\"><b>Заведующий отделом</b>&nbsp;&ndash; <b>Горская Светлана Николаевна &ndash; 8(0232)<strong style=\"font-weight: bold;\">25-49-20</strong></b></span></p>\n\n<p style=\"font-family: Arial, Verdana; font-size: 14px; font-style: normal; font-weight: normal; margin: 0px 0px 10px; padding: 0px; vertical-align: baseline; color: rgb(51, 51, 51); font-variant: normal; letter-spacing: normal; line-height: 20px; orphans: auto; text-align: justify; text-indent: 0px; text-transform: none; white-space: normal; widows: 1; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);\"><span style=\"font-family: inherit; font-size: 14px; font-style: inherit; font-weight: inherit; margin: 0px; padding: 0px; vertical-align: baseline; color: rgb(0, 0, 0);\">&nbsp;</span></p>\n"
