      "txt" : "<p>Оказывают следующие услуги по лабораторной диагностике.</p>\n\n<p>1.&nbsp; По физико-химическим показателям проводят:</p>\n\n<p>-анализ атмосферного воздуха и рабочей зоны;</p>\n\n<p>-лабораторные исследования товаров народного потребления (детский ассортимент, изделия, предназначенные для контакта с пищевыми продуктами, стройматериалы, мебель, одежда, ткани, обувь) в том числе медицинского назначения по разделу санитарно-химических испытаний модельных сред;</p>\n\n<p>-анализ сельскохозяйственной продукции;</p>\n\n<p>2. По физическим показателям:</p>\n\n<p>3. Микробиологические, вирусологические, паразитологические, токсикологические исследования;</p>\n\n<p>4. Проводят измерения уровня радона.</p>\n\n<p>5. Проводят анализ воды</p>\n\n<p>6. Проводят исследования парфюмерно-косметической продукции, товаров бытовой химии и автокосметики;</p>\n\n<p>7. Оказывают санитарно-гигиенические услуги.</p>\n",
