      "id" : 92670,
      "txt" : "<p><span style=\"color: rgb(68, 68, 68); font-family: &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 14px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 20px; orphans: auto; text-align: justify; text-indent: 0px; text-transform: none; white-space: normal; widows: 1; word-spacing: 0px; -webkit-text-stroke-width: 0px; display: inline !important; float: none; background-color: rgb(255, 255, 255);\">БРОО &laquo;Органик&raquo; ставит целью совершенствование&nbsp;и повсеместное внедрение внутренней системы сертификации продукции, а также дальнейшее развитие работы&nbsp;Потребительского инспекционно-аналитического совета, который позволит непосредственно самому потребителю участвовать и наблюдать как создаётся природой &laquo;живая еда&raquo; в хозяйствах нашей республики, как предприятия, в гармонии с природой, производят те продукты и вещи, которые продлевают жизнь Вашим родным и близким.</span></p>\n\n<p>&nbsp;</p>\n",
