      "txt" : "<p style=\"margin: 8px 0px; text-indent: 23px; color: rgb(51, 51, 51); font-family: Arial, Helvetica, sans-serif; font-size: 14px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 16px; orphans: auto; text-transform: none; white-space: normal; widows: 1; word-spacing: 0px; -webkit-text-stroke-width: 0px; text-align: justify; background-color: rgb(255, 255, 255);\">Деятельность Брестского Экологического Информационного Центра ОО &laquo;Экодом&raquo; проводится посредством реализации следующих задач:</p>\n\n<ul style=\"margin: 0px; padding: 0px; list-style-position: inside; color: rgb(51, 51, 51); font-family: Arial, Helvetica, sans-serif; font-size: 14px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 16px; orphans: auto; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 1; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);\">\n\t<li style=\"text-align: justify;\">содействие развитию и формированию экологического образования в Республике Беларусь;<br />\n\t&nbsp;</li>\n\t<li style=\"text-align: justify;\">поиск путей применения в Беларуси альтернативных источников энергии и эффективных технологий энергосбережения;<br />\n\t&nbsp;</li>\n\t<li style=\"text-align: justify;\">поддержка проектов, использующих экологические технологии строительства;<br />\n\t&nbsp;</li>\n\t<li style=\"text-align: justify;\">проведение экологических и культурных образовательных программ, таких как курсы для преподавателей экологии средних школ и ВУЗов, открытые уроки в школах и детских садах, детские праздники и т. п.;<br />\n\t&nbsp;</li>\n\t<li style=\"text-align: justify;\">содействие развитию экологически чистых технологий и утилизации отходов;<br />\n\t&nbsp;</li>\n\t<li style=\"text-align: justify;\">пропаганда волонтерского труда.</li>\n</ul>\n\n<p style=\"margin: 8px 0px; text-indent: 23px; color: rgb(51, 51, 51); font-family: Arial, Helvetica, sans-serif; font-size: 14px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 16px; orphans: auto; text-transform: none; white-space: normal; widows: 1; word-spacing: 0px; -webkit-text-stroke-width: 0px; text-align: justify; background-color: rgb(255, 255, 255);\">&nbsp;</p>\n\n<p style=\"margin: 8px 0px; text-indent: 23px; color: rgb(51, 51, 51); font-family: Arial, Helvetica, sans-serif; font-size: 14px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 16px; orphans: auto; text-transform: none; white-space: normal; widows: 1; word-spacing: 0px; -webkit-text-stroke-width: 0px; text-align: justify; background-color: rgb(255, 255, 255);\">&nbsp;&nbsp;&nbsp; Наша деятельность включает различные виды активностей, начиная от длительных проектов и заканчивая одноразовыми акциями и флэшмобами.</p>\n\n<p style=\"margin: 8px 0px; text-indent: 23px; color: rgb(51, 51, 51); font-family: Arial, Helvetica, sans-serif; font-size: 14px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 16px; orphans: auto; text-transform: none; white-space: normal; widows: 1; word-spacing: 0px; -webkit-text-stroke-width: 0px; text-align: justify; background-color: rgb(255, 255, 255);\">&nbsp;</p>\n\n<p style=\"margin: 8px 0px; text-indent: 23px; color: rgb(51, 51, 51); font-family: Arial, Helvetica, sans-serif; font-size: 14px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 16px; orphans: auto; text-transform: none; white-space: normal; widows: 1; word-spacing: 0px; -webkit-text-stroke-width: 0px; text-align: justify; background-color: rgb(255, 255, 255);\">&nbsp;&nbsp;&nbsp; Основная часть наших мероприятий проводится по следующим направлениям:</p>\n\n<ul style=\"margin: 0px; padding: 0px; list-style-position: inside; color: rgb(51, 51, 51); font-family: Arial, Helvetica, sans-serif; font-size: 14px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 16px; orphans: auto; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 1; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);\">\n\t<li style=\"text-align: justify;\"><a href=\"http://bresteco.by/index.php/component/content/12-klimat/21-klimat\" style=\"text-decoration: none; color: rgb(166, 86, 0);\">Глобальное Изменение Климата</a><a href=\"http://bresteco.by/index.php/component/content/4-energia/20-energia\" style=\"text-decoration: none; color: rgb(166, 86, 0);\"><span><span>&nbsp;</span></span></a></li>\n\t<li><a href=\"http://bresteco.by/index.php/component/content/20\" style=\"text-decoration: none; color: rgb(166, 86, 0);\">Энергия и энергосбережение</a></li>\n\t<li><a href=\"http://bresteco.by/index.php/component/content/22\" style=\"text-decoration: none; color: rgb(166, 86, 0);\">Устойчивое развитие</a></li>\n\t<li style=\"text-align: justify;\"><a href=\"http://bresteco.by/index.php/component/content/23\" style=\"text-decoration: none; color: rgb(166, 86, 0);\">Отходы</a></li>\n\t<li style=\"text-align: justify;\"><a href=\"http://bresteco.by/index.php/component/content/7-2012-02-12-20-42-05/24-voda\" style=\"text-decoration: none; color: rgb(166, 86, 0);\">Вода</a></li>\n</ul>\n\n<p style=\"margin: 8px 0px; text-indent: 23px; color: rgb(51, 51, 51); font-family: Arial, Helvetica, sans-serif; font-size: 14px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 16px; orphans: auto; text-transform: none; white-space: normal; widows: 1; word-spacing: 0px; -webkit-text-stroke-width: 0px; text-align: justify; background-color: rgb(255, 255, 255);\">&nbsp;</p>\n"
