      "txt" : "<div style=\"font-size: 12px; color: rgb(0, 0, 0); font-family: Arial, Verdana, Tahoma, Helvetica, sans-serif; text-align: justify; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: normal; orphans: auto; text-indent: 0px; text-transform: none; white-space: normal; widows: 1; word-spacing: 0px; -webkit-text-stroke-width: 0px;\"><span style=\"font-size: 10pt; font-family: Arial;\"><strong><span style=\"color: rgb(153, 51, 0);\">Белорусское общественное объединение &laquo;Отдых в деревне&raquo;</span></strong> - некоммерческая организация, созданная 16 октября 2003 г. В ее состав входит более 700 человек. Это главным образом жители сельской местности Беларуси, которые хотят освоить новую профессию и организовать на своих усадьбах мини гостиницы типа &ldquo;Bed&amp;Breakfast&rdquo;. БОО &laquo;Отдых в деревне&raquo; - одно из немногих общественных объединений, которое работает с сельским населением и пытается развивать их экономическую и социальную активность.</span></div>\n\n<div style=\"font-size: 12px; color: rgb(0, 0, 0); font-family: Arial, Verdana, Tahoma, Helvetica, sans-serif; text-align: justify; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: normal; orphans: auto; text-indent: 0px; text-transform: none; white-space: normal; widows: 1; word-spacing: 0px; -webkit-text-stroke-width: 0px;\">&nbsp;</div>\n\n<div style=\"font-size: 12px; color: rgb(0, 0, 0); font-family: Arial, Verdana, Tahoma, Helvetica, sans-serif; text-align: justify; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: normal; orphans: auto; text-indent: 0px; text-transform: none; white-space: normal; widows: 1; word-spacing: 0px; -webkit-text-stroke-width: 0px; margin-bottom: 0.0001pt;\"><span style=\"font-size: 10pt; font-family: Arial;\"><strong><span style=\"font-size: 10pt; font-family: Arial;\">В задачи организации входит:</span></strong><br />\n<span style=\"font-size: 10pt; font-family: Arial;\">&bull;привлечение граждан к занятию сельским и экологическим туризмом;<br />\n&bull;у<span style=\"font-family: arial, helvetica, sans-serif;\">силение их экономической и социальной активности;<br />\n<span style=\"font-family: arial, helvetica, sans-serif;\">&bull;популяризация сельского и экологического туризма среди населения;<br />\n<span style=\"font-family: arial, helvetica, sans-serif;\">&bull;содействие развитию национального законодательства;<br />\n<span style=\"font-family: arial, helvetica, sans-serif;\">&bull;содействие развитию международного сотрудничества.</span></span></span></span></span></span></div>\n\n<div style=\"font-size: 12px; color: rgb(0, 0, 0); font-family: Arial, Verdana, Tahoma, Helvetica, sans-serif; text-align: justify; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: normal; orphans: auto; text-indent: 0px; text-transform: none; white-space: normal; widows: 1; word-spacing: 0px; -webkit-text-stroke-width: 0px; margin-bottom: 0.0001pt;\">\n<div style=\"font-size: 12px; color: rgb(0, 0, 0); font-family: Arial, Verdana, Tahoma, Helvetica, sans-serif; text-align: justify; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: normal; orphans: auto; text-indent: 0px; text-transform: none; white-space: normal; widows: 1; word-spacing: 0px; -webkit-text-stroke-width: 0px; margin-bottom: 0.0001pt;\"><span style=\"font-size: 10pt; font-family: Arial;\"><strong><span style=\"font-family: Arial;\">Основные направления деятельности:</span></strong><br />\n- подготовка обучающих программ, проведение семинаров, тренингов;<br />\n- разработка стандартов для классификации усадеб, сертификация усадеб в соответствии со стандартом организации;<br />\n- продвижение туристического продукта Отдых в белорусской деревни на международном и внутреннем рынках;<br />\n- взаимодействие с другими организациями в области развития агроэкотуризма; совершенствование и разработка новых туристических продуктов</span></div>\n\n<div style=\"font-size: 12px; color: rgb(0, 0, 0); font-family: Arial, Verdana, Tahoma, Helvetica, sans-serif; text-align: justify; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: normal; orphans: auto; text-indent: 0px; text-transform: none; white-space: normal; widows: 1; word-spacing: 0px; -webkit-text-stroke-width: 0px; margin: 0cm 0cm 0.0001pt;\"><span style=\"font-size: 10pt; font-family: Arial;\">Основные источники финансирования Организации &ndash; это членские взносы, гранты, добровольные пожертвования, донорская помощь. Именно они позволили объединению работать так активно.<br />\nУ инициаторов создания организации и членов правления имеется значительный опыт деятельности в этой области. Большинство ее учредителей занимались организацией &laquo;сельского&raquo; туризма в другом качестве: сотрудники туристских агентств, менеджеры туристско-экскурсионных программ в музейном комплексе &laquo;Дудутки&raquo;. Они имеют значительный опыт в организации туристских услуг в сельской местности.</span></div>\n</div>\n",
