      "place" : "Минск",
      "txt" : "<h1 style=\"font-size: 22px; color: olivedrab; font-family: Arial; text-align: left; font-variant: small-caps; font-style: normal; letter-spacing: normal; line-height: normal; orphans: auto; text-indent: 0px; text-transform: none; white-space: normal; widows: 1; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);\"><a color=\"#30924E\" name=\"sc_nmio\"></a></h1>\n\n<p align=\"center\"><a color=\"#30924E\" name=\"sc_nmio\">Республиканское унитарное предприятие<br />\n&laquo;Научно-практический центр гигиены&raquo;</a></p>\n\n<p style=\"color: rgb(0, 0, 139); font-family: Arial; font-size: 14px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: normal; orphans: auto; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 1; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);\">&nbsp;</p>\n\n<h2 style=\"font-size: 18px; color: darkseagreen; padding-top: 0px; font-family: Arial; font-style: normal; font-variant: normal; letter-spacing: normal; line-height: normal; orphans: auto; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 1; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);\"><a color=\"#30924E\" name=\"sc_nmio\"></a></h2>\n\n<p align=\"center\"><a color=\"#30924E\" name=\"sc_nmio\">выполняет работы и оказывает услуги:</a></p>\n\n<p><a color=\"#30924E\" name=\"sc_nmio\" style=\"color: rgb(0, 0, 139); font-family: Arial; font-size: 14px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: normal; orphans: auto; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 1; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);\"></a></p>\n\n<p>&nbsp;</p>\n\n<ul style=\"color: rgb(0, 0, 139); font-family: Arial; font-size: 14px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: normal; orphans: auto; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 1; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);\">\n\t<li>разработка и обоснование гигиенических нормативов<br />\n\t&nbsp;</li>\n\t<li>консультации по вопросам обеспечения санитарно-эпидемиологического благополучия и здорового образа жизни<br />\n\t&nbsp;</li>\n\t<li>санитарно-микробиологические исследования объектов окружающей среды, товаров народного потребления<br />\n\t&nbsp;</li>\n\t<li>проведение санитарно-гигиенических исследований<br />\n\t&nbsp;</li>\n\t<li>проведение токсикологических исследований<br />\n\t&nbsp;</li>\n\t<li>проведение молекулярно-биологических исследований<br />\n\t&nbsp;</li>\n\t<li>проведение санитарно-химических исследований<br />\n\t&nbsp;</li>\n\t<li>определение параметров физических факторов<br />\n\t&nbsp;</li>\n\t<li>санитарно-гигиеническая и эпидемиологическая экспертиза предпроектной, проектной, нормативной и эксплуатационной документации<br />\n\t&nbsp;</li>\n\t<li>инструментальные измерения факторов производственной среды, тяжести и напряженности трудового процесса для аттестации рабочих мест на предприятиях и в организациях; консультативно-методическая помощь в оформлении карт аттестации рабочего места по условиям труда<br />\n\t&nbsp;</li>\n\t<li>определение класса опасности промышленных отходов (токсичность, экотоксичность)<br />\n\t&nbsp;</li>\n\t<li>оценка риска воздействия факторов окружающей среды на здоровье населения, в том числе для корректировки размеров санитарно-защитных зон объектов<br />\n\t&nbsp;</li>\n\t<li>экспертиза документов для согласования паспортов безопасности<br />\n\t&nbsp;</li>\n\t<li>подтверждение соответствия продукции в Национальной системе подтверждения соответствия, в том числе признание иностранных сертификатов соответствия<br />\n\t&nbsp;</li>\n\t<li>подтверждение соответствия продукции в рамках Таможенного союза с выдачей документов по единой форме<br />\n\t&nbsp;</li>\n\t<li>оказание консалтинговых услуг по принятию деклараций о соответствии по Единой форме на соответствие требованиям ТР ТС<br />\n\t&nbsp;</li>\n\t<li>изготовление копий (ксерокопий) сертификатов соответствия<br />\n\t&nbsp;</li>\n\t<li>разработка новых метрологически аттестованных методик выполнения измерений по определению показателей качества и безопасности объектов окружающей среды, товаров народного потребления, пищевых продуктов</li>\n</ul>\n",
