      "place" : "Витебск",
      "txt" : "<p>Мероприятия реализуемые на базе Витебского областного дворца детей и молодежи</p>\n\n<p>Учебно-экологический комплекс Витьба</p>\n\n<p>Пешеходная экологическая тропа (3 км) по учебному эколого-биологическому комплексу и парковой зоне реки Витьба.</p>\n\n<p>Основные направления деятельности</p>\n\n<p>экология и&nbsp;охрана природы, зоология;</p>\n\n<p>растениеводство, овощеводство;</p>\n\n<p>аквариумистика, генетика;</p>\n\n<p>энтомология, микробиология;</p>\n\n<p>садоводство, ихтиология;</p>\n\n<p>цветоводство, ландшафтный и&nbsp;цветочный дизайн;</p>\n\n<p>фитотерапия, фитодизайн, соломоплетение.</p>\n\n<p>Для&nbsp;школьников младшего и&nbsp;среднего возраста&nbsp;наиболее интересны занятия в&nbsp;объединениях по интересам &mdash; &laquo;Декоративное птицеводство&raquo;, &laquo;Мой&nbsp;домашний друг&raquo;, &laquo;Аквариумистика&raquo;, где&nbsp;можно научиться уходу за&nbsp;живыми птицами.</p>\n\n<p>Для&nbsp;школьников среднего возраста&nbsp;интересны занятия объединениях по интересам: &laquo;Соломенная мастерская&raquo;, &laquo;Комнатное и&nbsp;оранжерейное цветоводство&raquo;, &laquo;Цветочный дизайн&raquo;, &laquo;Ландшафтный дизайн&raquo;, &laquo;Овощеводство&raquo;, &laquo;Растениеводство&raquo;, &laquo;Природа и&nbsp;фантазия&raquo;, &laquo;Садоводство&raquo;.</p>\n\n<p>Для&nbsp;старшеклассников&nbsp;работают объединения по интересам: &laquo;Овощеводы-экологи&raquo;, &laquo;Экология и&nbsp;охрана окружающей среды&raquo; и&nbsp;секции научного общества учащихся &laquo;Энтомология&raquo;, &laquo;Генетика&raquo;, &laquo;Микробиология&raquo;, &laquo;Ихтиология&raquo;, где&nbsp;можно освоить основы исследовательской деятельности и&nbsp;научного эксперимента.</p>\n",
