      "id" : 92626,
      "txt" : "<p style=\"text-align: justify;\">Речицкий эколого-культурный центр был открыт в 2008 году на Республиканском экологическом форуме, который проходит ежегодно по инициативе Министерства природных ресурсов и охраны окружающей среды.</p>\n\n<p style=\"text-align: justify;\">С первых дней существования экологического центра &laquo;экскурсии&raquo; в доисторические времена, а также в уникальные уголки живой природы привлекают не только местных жителей. Гости сюда приезжают со всей Беларуси. Как отмечает директор Речицкого эколого-культурного центра Наталья Игнатенко, формат экскурсии подбирается индивидуально и напрямую зависит от возраста посетителей центра. Например, о природе и экологической обстановке в Беларуси дошколята узнают от сказочных персонажей, а закрепить полученную информацию смогут просмотром экологического мультфильма, устроившись на импровизированной лесной поляне.</p>\n\n<p style=\"text-align: justify;\">Сотрудники центра инициируют и множество других мероприятий: акции, тематические занятия, экологические лекции, кинолектории. Например, кинолектории стали традицией, они проводятся не только с детьми, но с работниками медицинской и природоохранной сфер.</p>\n\n<p style=\"text-align: justify;\">Ещё одной интересной формой работы являются творческие студии для детей.</p>\n\n<p style=\"text-align: justify;\">Под крышей Центра расположились 2 выставочных зала с великолепными экспозициями: о зарождении и этапах становления жизни на земле, о современной природе и экологии, об особенностях подземной жизни растений и животных и о многом другом.</p>\n\n<p style=\"text-align: justify;\">Коллекции и экспозиции&nbsp; служат не только витриной настоящего или минувшего, но и отправной точкой нового мышления. Ведь этот центр был создан с целью показать посетителям состояние экологической обстановки на сегодняшний день в мире и, в частности, у нас в Беларуси, рассказать о воздействии&nbsp; человека на окружающую среду в процессе его жизнедеятельности.</p>\n",
