      "txt" : "<p>Предоставляют на сайте www.priroda.brest.by экологическую информацию общего назначения.</p>\n\n<p>Предоставляют по запросу:</p>\n\n<p>Данные о результатах государственного аналитического контроля в области охраны окружающей среды, в т.ч. о выбросах от стационарных и мобильных источниках, сбросах сточных вод, эффективности работы очистных сооружений по чистке вод, мониторинге поверхностных вод, загрязнении земель (почв), зафиксированных превышениях установленных нормативов и принятых мерах по привлечению виновных лиц к ответственности и возмещении вредя, причиненного окружающей среде</p>\n\n<p>Информация о проведении оценки воздействия планируемой хозяйственной деятельности на окружающую среду</p>\n\n<p>Результаты проведения экологической экспертизы</p>\n\n<p>Информация о выданных заключениях о соответствии принимаемого в эксплуатацию объекта утвержденной проектной документации</p>\n\n<p>Аналитические данные о результатах проведения природопользователями локального мониторинга в зависимости от вида оказываемого вредного воздействия на окружающую среду, в т.ч. выбросах загрязняющих веществ в атмосферный воздух от стационарных источников; сбросах сточных вод в водные объекты; подземных водах в районе расположения выявленных и потенциальных источников их загрязнения; землях (включая почвы) в районе расположения выявленных или потенциальных источников их загрязнения</p>\n\n<p>Данные о разрешенных объемах изъятия поверхностных вод, добыче подземных вод, отведении сточных вод в разрезе природопользователей, нормативных значениях концентраций загрязняющих веществ на выпуске сточных вод в водные объекты, сроках и условиях действия таких разрешений на спецводопользование, выполнении условий</p>\n\n<p>Информация об особо охраняемых природных территориях (ООПТ), функционирующих в области, региональной схеме развития ООПТ, результатах контроля за соблюдением установленных для ООПТ режимах ведения хозяйственной и иной деятельности</p>\n\n<p>Информация о наличии, распространении на территории области инвазивных видов растений, принимаемых мерах по борьбе с ними</p>\n\n<p>Информация об объектах захоронения отходов, схемах обращения с отходами на территории г.Бреста и районах области, в садоводческих товариществах и гаражных кооперативах</p>\n\n<p>Информация о планировании, реализации и финансировании из средств областного бюджета, направленных на охрану окружающей среды, природоохранных мероприятий, их экологическом эффекте</p>\n",
