      "txt" : "<p>По запросу предоставляют информацию :</p>\n\n<p>Данные учета природопользователей, оказывающих воздействие на окружающую среду, в соответствии с критериями отнесения их к одной из групп риска (высокая, средняя, низкая)</p>\n\n<p>Данные учета природопользователей, оказывающих воздействие на окружающую среду, в соответствии с критериями отнесения их к одной из групп риска (высокая, средняя, низкая)</p>\n\n<p>Данные о совершенных правонарушениях в области охраны окружающей среды и рационального природопользования, административных санкциях, примененных с целью его пресечения, наложенных административных взысканиях и их взыскании в разрезе каждого виновного лица</p>\n\n<p>Данные о результатах государственного аналитического контроля в области охраны окружающей среды, в т.ч. о выбросах от стационарных и мобильных источников, сбросах сточных вод, эффективности работы очистных сооружений по чистке вод, мониторинге поверхностных вод, загрязнении земель (почв), зафиксированных превышениях установленных нормативов и принятых мерах по привлечению виновных лиц к ответственности и возмещению вреда, причиненного окружающей среде</p>\n\n<p>Результаты проведения экологической экспертизы</p>\n\n<p>Данные об организации и осуществлении ведения локального мониторинга окружающей среды, финансировании&nbsp; данных мероприятий</p>\n\n<p>Данные о выдаче специальных разрешений, иных разрешений и документов, на основании которых осуществляется природопользование, внесении изменений и (или) дополнений в эти разрешения и иные документы, приостановлении, возобновлении, продлении срока действия, прекращения их действия</p>\n\n<p>Информация о наличии, распространении на территории г. Минска инвазивных видов растений, принимаемых мерах по борьбе с ними</p>\n\n<p>Материалы и отчеты о ходе реализации на территории г. Минска мероприятий по наведению порядка на земле и благоустройству территорий г. Минска</p>\n\n<p>Информация об авариях и инцидентах, оказавших воздействие на окружающую среду, принятых мерах по восстановлению нарушенного состояния, компенсации вреда, причиненного окружающей среде, привлечении виновных лиц к ответственности</p>\n\n<p>&nbsp;</p>\n",
