      "txt" : "<p>Предоставляют информацию по запросу:</p>\n\n<p>Данные о заборе и использовании воды организациями отрасли</p>\n\n<p>Данные о выбросах загрязняющих веществ в атмосферный воздух от стационарных источников организаций отрасли</p>\n\n<p>Данные о распределении механических транспортных средств организаций отрасли по экологическим классам</p>\n\n<p>Данные об образовании, использовании и размещении отходов производства в организациях отрасли</p>\n",
