      "phones" : "(8-017) 290-59-50, Ф. (8-017) 285-33-01",
      "time" : "Понедельник - четверг: Начало рабочего дня  - 8.30 Окончание рабочего дня - 17.30 Перерыв для питания и отдыха - с 13.00 до 13.45 Пятница: Начало рабочего дня  - 8.30 Окончание рабочего дня - 16.15 Перерыв для питания и отдыха - с 13.00 до 13.45 Выходные дни - суббота, воскресенье",
      "txt" : "<p>Основные направления деятельности Центра<br />\nОсновные направления деятельности Центра:<br />\n1. Аналитический (лабораторный) контроль в области охраны окружающей среды:<br />\n- выбросов загрязняющих веществ в атмосферный воздух от стационарных источников;<br />\n- выбросов загрязняющих веществ в атмосферный воздух от мобильных источников на предприятиях и автодорогах;<br />\n- сточных вод, отводимых в водные объекты;<br />\n- поверхностных вод в районе расположения источников сбросов сточных вод;<br />\n- земель (включая почвы) в районе расположения выявленных или потенциальных источников их загрязнения;<br />\n- состава топлива;<br />\n- физико-химического состава отходов, направляемых на хранение, захоронение и (или) обезвреживание.<br />\n2. Мониторинг окружающей среды.<br />\nПроведение наблюдений за состоянием поверхностных вод на государственной сети Национальной системы мониторинга окружающей среды.<br />\n3. Участие в реализации требований международных соглашений.</p>\n",
