      "txt" : "<p>Общественная организация &laquo;Ахова птушак Бацькаўшчыны&raquo; работает ради сохранения разнообразия видов и экосистем в Беларуси путем вовлечения населения в природоохранную деятельность.<br />\nОсновными целями АПБ являются:<br />\nСохранение биологического разнообразия;<br />\nВовлечение населения в природоохранную деятельность.<br />\nМиссия АПБ<br />\nСохранить птиц и биоразнообразие дикой природы, объединяя для этого людей.<br />\nЗадачи АПБ:</p>\n\n<ul>\n\t<li>Изучение и сохранение биоразнообразия, особенно разнообразия диких птиц;</li>\n\t<li>Выявление, изучение, сохранение и (при необходимости) восстановление природных территорий, важных для сохранения биоразнообразия, особенно для диких птиц;</li>\n\t<li>Сохранение природных экосистем;</li>\n\t<li>Поощрение населения к практическим действиям по сохранению биоразнообразия, в особенности диких птиц и природных территорий, повышение экологического сознания населения;</li>\n\t<li>Содействие устойчивому использованию природных ресурсов.</li>\n</ul>\n",
