      "title" : "МОО «Экопартнерство»",
      "lat" : 53.92605378383,
      "phones" : "тел.: +375 17 336 01 90\\91 факс: + 375 17 336 01 89 раб.моб.: +375 29 106 67 10 эл. почта: office@ecopartnerstvo.by",
      "tree" : "Объект",
      "type" : 3916,
      "place" : "Минск",
      "txt" : "<p style=\"margin: 0px 0px 16px; padding: 0px; border: 0px; font-style: normal; font-variant: normal; font-weight: 100; font-stretch: inherit; font-size: 16px; line-height: 24px; font-family: Museo_100, sans-serif; vertical-align: baseline; color: rgb(98, 98, 98); letter-spacing: normal; orphans: auto; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 1; word-spacing: 0px; -webkit-text-stroke-width: 0px;\">За годы работы МОО &laquo;Экопартнёрство&raquo; реализовало более 20 международных проектов, направленных на повышение информированности общественности и решение экологических проблем по следующим темам:</p>\n\n<ul style=\"margin: 0px; padding: 0px; border: 0px; font-style: normal; font-variant: normal; font-weight: 100; font-stretch: inherit; font-size: 16px; line-height: 24px; font-family: Museo_100, sans-serif; vertical-align: baseline; list-style: none; color: rgb(98, 98, 98); letter-spacing: normal; orphans: auto; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 1; word-spacing: 0px; -webkit-text-stroke-width: 0px;\">\n\t<li style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;\">- качество питьевой воды и ее влияние на здоровье, организация систем очистки бытовых стоков;</li>\n\t<li style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;\">- практические способы экономии энергии и предотвращение изменения климата;</li>\n\t<li style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;\">- обращение с отходами с минимизацией ущерба для окружающей среды;</li>\n\t<li style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;\">- потребление товаров с учетом экологических аспектов;</li>\n\t<li style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;\">- устойчивое развитие на региональном уровне.</li>\n</ul>\n\n<p style=\"margin: 0px 0px 16px; padding: 0px; border: 0px; font-style: normal; font-variant: normal; font-weight: 100; font-stretch: inherit; font-size: 16px; line-height: 24px; font-family: Museo_100, sans-serif; vertical-align: baseline; color: rgb(98, 98, 98); letter-spacing: normal; orphans: auto; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 1; word-spacing: 0px; -webkit-text-stroke-width: 0px;\">За время реализации этих проектов были организованы круглые столы, семинары и тренинги, к участию в которых приглашались специалисты и представители общественности: НГО, органы государственного управления; СМИ и другие заинтересованные из разных городов Беларуси. В рамках проектов было издано большое количество информационных материалов на экологические темы, которые распространялись среди участников мероприятий, публиковались на сайте организации, в местных и республиканских СМИ.</p>\n",
