      "type" : 3916,
      "tree" : "Объект",
      "phones" : "+375-29-565-82-91 info@bike.org.by",
      "lat" : 53.9103997839,
      "txt" : "<p style=\"margin: 0px 0px 0.5em; text-indent: 1em; text-align: justify; color: rgb(74, 74, 74); font-family: Tahoma, Arial, sans-serif; font-size: 14.994px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 19.4922px; orphans: auto; text-transform: none; white-space: normal; widows: 1; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);\">Минское велосипедное общество было создано в 2011 году группой активистов, небезразличных к будущему велосипедного движения в своём городе и Беларуси в целом.</p>\n\n<p style=\"margin: 0px 0px 0.5em; text-indent: 1em; text-align: justify; color: rgb(74, 74, 74); font-family: Tahoma, Arial, sans-serif; font-size: 14.994px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 19.4922px; orphans: auto; text-transform: none; white-space: normal; widows: 1; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);\">Цель организации &mdash; развитие велосипедного движения в его повседневном значении: городского велосипедного транспорта, &laquo;велокультуры&raquo;, велосипедного туризма,<br />\nдоступного для всех.</p>\n\n<p style=\"margin: 0px 0px 0.5em; text-indent: 1em; text-align: justify; color: rgb(74, 74, 74); font-family: Tahoma, Arial, sans-serif; font-size: 14.994px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 19.4922px; orphans: auto; text-transform: none; white-space: normal; widows: 1; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);\">Одна из основных целей общества &ndash; это развитие сети удобных велосипедных дорожек по всему Минску и всей сопутствующей инфраструктуры, превращение Минска в город, удобный для перемещения на велосипеде. Минск &mdash; город с идеальными условиями для развития велоинфраструктуры: относительно плоский рельеф, широкие улицы и тротуары, относительная компактность.</p>\n\n<p style=\"margin: 0px 0px 0.5em; text-indent: 1em; text-align: justify; color: rgb(74, 74, 74); font-family: Tahoma, Arial, sans-serif; font-size: 14.994px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 19.4922px; orphans: auto; text-transform: none; white-space: normal; widows: 1; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);\">Другие направления:</p>\n\n<ul style=\"margin: 1em 0px; padding: 0px 0px 0.25em 2.5em; display: inline-block; color: rgb(74, 74, 74); font-family: Tahoma, Arial, sans-serif; font-size: 14.994px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 19.4922px; orphans: auto; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 1; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);\">\n\t<li>развитие городской велокультуры во всех её смыслах;</li>\n\t<li>развитие велотуризма за городом, доступного для всех: создание официальных маркированных маршрутов, помощь локальным инициативам;</li>\n\t<li>проект EuroVelo-2 &ndash; создание белорусского участка туристического веломаршрута Голуэй-Москва;</li>\n\t<li>защита интересов велосипедистов.</li>\n</ul>\n",
