      "lon" : 30.256678499999,
      "place" : "Витебск",
      "txt" : "<p>Осуществляют отбор проб атмосферного воздуха в населенных пунктах и санитарно-защитных зонах промышленных предприятий, определение их содержания: азота оксида, серы диоксида, азота диоксида, углерода оксида, аммиака, фенолов, пыли, формальдегида, летучих органических соединений</p>\n\n<p>&nbsp;Отбор проб воды из водоемов и водотоков с определением примесей и показателей</p>\n\n<p>Справка о величине фоновых концентраций вредных веществ (мг/м&sup3;), метеорологических характеристик и коэффициенте, определяющем условия рассеивания загрязняющих веществ в атмосфере.</p>\n",
