      "phones" : "8 (0212)42-65-60, 42-65-41",
      "txt" : "<p>Осуществляют государственный контроль в области охраны окружающей среды;</p>\n\n<p>&nbsp;- регулирование рационального использования природных ресурсов;</p>\n\n<p>&nbsp;- информирование госорганов, организаций и граждан о состоянии и загрязнении окружающей среды.</p>\n",
