      "place" : "Минск",
      "txt" : "<p>Зеленая сеть - сообщество экологических организаций, активистов, инициатив, экспертов, которые объединились в сеть, чтобы решать те экологические проблемы, которые невозможно решить одному.</p>\n\n<p>Товарищество&nbsp; действует&nbsp; с 6 ноября 2007 года.</p>\n\n<p>На сегодня в товарищество&nbsp; входят 15 экологических общественных объединений и 40 индивидуальных участников.<br />\nОрганизации и активисты товарищества работают в Минске, Гродно, Гомеле, Барановичах, Бресте и других городах Беларуси.</p>\n\n<p>&nbsp;</p>\n",
