      "title" : "Учреждение \"Центр экологических решений\"",
      "addr" : "проспект Машерова 9-111",
      "time" : "ПН -ПТ С 10.00-18.00",
      "type" : 3916,
      "tree" : "Объект",
      "lat" : 53.91563428389,
      "phones" : "+375-17-334-53-23;",
      "txt" : "<p class=\"rtejustify\" style=\"margin: 1.5em 0px; text-align: justify; color: rgb(34, 34, 34); font-family: &quot;Gotham Pro Regular&quot;, &quot;open sans&quot;, sans-serif; font-size: 14px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 24px; orphans: auto; text-indent: 0px; text-transform: none; white-space: normal; widows: 1; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);\"><strong style=\"font-weight: bold;\">Центр экологических решений&nbsp;</strong>&ndash; это некоммерческое неправительственное учреждение, созданное в 2009 году с целью популяризации экологически дружественного образа жизни и принципов устойчивого развития, развития международного сотрудничества с целью сохранения окружающей среды.</p>\n\n<p class=\"rtejustify\" style=\"margin: 1.5em 0px; text-align: justify; color: rgb(34, 34, 34); font-family: &quot;Gotham Pro Regular&quot;, &quot;open sans&quot;, sans-serif; font-size: 14px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 24px; orphans: auto; text-indent: 0px; text-transform: none; white-space: normal; widows: 1; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);\">Учреждение &laquo;Центр экологических решений&raquo; (ЦЭР) / Center for Environmental Solutions (CES) было зарегистрировано 5 февраля 2009 года как некоммерческое неправительственное учреждение. Организация находится в Минске, деятельность охватывает всю Беларусь. Организация принимает активное участие в международной деятельности, направленной на охрану окружающей среды и здоровья людей. Инициаторами создания организации стала группа людей, состоящая из волонтеров, экологических активистов, специалистов в области охраны окружающей среды (в частности, в области отходов и химической безопасности). На сегодняшний момент в ЦЭР работает <a href=\"http://ecoidea.by/about#tabs-0-main-2\" style=\"color: rgb(70, 175, 41) !important; text-decoration: none; font-style: normal; font-weight: normal;\">19 человек</a>.</p>\n\n<p class=\"rtejustify\" style=\"margin: 1.5em 0px; text-align: justify; color: rgb(34, 34, 34); font-family: &quot;Gotham Pro Regular&quot;, &quot;open sans&quot;, sans-serif; font-size: 14px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 24px; orphans: auto; text-indent: 0px; text-transform: none; white-space: normal; widows: 1; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);\"><strong style=\"font-weight: bold;\">Миссия организации</strong> &ndash; популяризация экологически дружественного образа жизни и принципов устойчивого развития, развитие международного сотрудничества с целью сохранения окружающей среды.</p>\n\n<p class=\"rtejustify\" style=\"margin: 1.5em 0px; text-align: justify; color: rgb(34, 34, 34); font-family: &quot;Gotham Pro Regular&quot;, &quot;open sans&quot;, sans-serif; font-size: 14px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 24px; orphans: auto; text-indent: 0px; text-transform: none; white-space: normal; widows: 1; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);\"><span style=\"line-height: 1.6;\"><strong style=\"font-weight: bold;\">Тематические направления работы</strong>:</span></p>\n\n<ul style=\"margin: 1.5em 0px; padding: 0px 0px 0px 30px; color: rgb(34, 34, 34); font-family: &quot;Gotham Pro Regular&quot;, &quot;open sans&quot;, sans-serif; font-size: 14px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 24px; orphans: auto; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 1; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);\">\n\t<li class=\"rtejustify\" style=\"text-align: justify;\"><span style=\"line-height: 1.6;\"><a href=\"http://ecoidea.by/energo\" style=\"color: rgb(70, 175, 41); text-decoration: none;\">Энергоэффективность и энергосбережение</a>;</span></li>\n\t<li class=\"rtejustify\" style=\"text-align: justify;\"><a href=\"http://ecoidea.by/waste\" style=\"color: rgb(70, 175, 41); text-decoration: none;\">Отходы</a>;</li>\n\t<li class=\"rtejustify\" style=\"text-align: justify;\"><a href=\"http://ecoidea.by/chemical-safety\" style=\"color: rgb(70, 175, 41); text-decoration: none;\">Химическая безопасность</a>;</li>\n\t<li class=\"rtejustify\" style=\"text-align: justify;\"><span style=\"line-height: 1.6;\"><a href=\"http://ecoidea.by/eco-choice\" style=\"color: rgb(70, 175, 41); text-decoration: none;\">Экологический выбор</a>;</span></li>\n\t<li class=\"rtejustify\" style=\"text-align: justify;\"><a href=\"http://ecoidea.by/water\" style=\"color: rgb(70, 175, 41); text-decoration: none;\">Вода и управление водными ресурсами</a>;</li>\n\t<li class=\"rtejustify\" style=\"text-align: justify;\"><span style=\"line-height: 1.6;\"><a href=\"http://ecoidea.by/organic-farming\" style=\"color: rgb(70, 175, 41); text-decoration: none;\">Органическое сельское хозяйство</a>;</span></li>\n\t<li class=\"rtejustify\" style=\"text-align: justify;\"><a href=\"http://ecoidea.by/cities-transport\" style=\"color: rgb(70, 175, 41); text-decoration: none;\">Города и транспорт</a>.</li>\n</ul>\n",
